const LoginForm = () => {
  const formSubmitHandler = (event) => {};

  return (
    <section className="max-container w-full flex flex-col justify-center gap-10 pt-16 xl:flex-row">
      <form
        onSubmit={formSubmitHandler}
        className="bg-black  relative xl:3/5 flex flex-col justify-center items-center max-xl:padding-x max-container align-middle mt-12 pt-12"
      >
              <div>
                  <label htmlFor="name">Enter your name</label>
                  <input type='text' id="name" ></input>
        </div>
      </form>
    </section>
  );
};

export default LoginForm;
